$templateCache.put('dashboard/report/genomic/appendices/appendices.html','<section class="appendices"><md-subheader class="md-primary">Appendices</md-subheader><div layout="column" flex="flex"><div layout="column" flex="flex"><h2 class="title">Appendix A</h2><h3 class="title">Sample Information</h3><div class="dataBox" layout="column" flex="flex"><div class="box"><div class="heading" layout="row" flex="flex"><div flex="flex">Sample</div><div flex="flex">Sample Name</div><div flex="flex">Collection Date</div><div flex="flex">Primary Site</div><div flex="30">Biopsy Site</div><div flex="flex">Pathology Estimated Tumour Content</div></div><div class="row" layout="row" flex="flex" ng-repeat="sample in report.sampleInfo"><div flex="flex">{{sample[\'Sample\']}}</div><div flex="flex">{{sample[\'Sample Name\']}}</div><div flex="flex">{{sample[\'Collection Date\']}}</div><div flex="flex">{{sample[\'Primary Site\']}}</div><div flex="30">{{sample[\'Biopsy Site\']}}</div><div flex="flex">{{sample[\'Patho TC\']}}</div></div></div></div><h3 class="title">Sequencing QC</h3><div class="dataBox" layout="column" flex="flex"><div class="box"><div class="heading" layout="row" flex="flex"><div flex="flex">Type</div><div flex="flex">Sample Name</div><div flex="flex">Input (ng)</div><div flex="flex">Library Construction Protocol</div><div flex="flex">Library</div><div flex="flex">Lab QC</div><div flex="flex">Sequencing QC</div><div flex="flex">% Duplicates</div><div flex="flex">Total Coverage</div><div flex="flex"># Reads</div></div><div class="row" layout="row" flex="flex" ng-repeat="qc in report.seqQC"><div flex="flex">{{qc[\'Sample\']}}</div><div flex="flex">{{qc[\'Sample Name\']}}</div><div flex="flex">{{qc[\'Input_ng\']}}</div><div flex="flex">{{qc[\'Protocol\']}}</div><div flex="flex">{{qc[\'Library\']}}</div><div flex="flex">{{qc[\'labQC\']}}</div><div flex="flex">{{qc[\'bioQC\']}}</div><div flex="flex">{{qc[\'Duplicate_Reads_Perc\']}}</div><div flex="flex">{{qc[\'Coverage\']}}</div><div flex="flex">{{qc[\'Reads\']}}</div></div></div></div><h2 class="title">Appendix B</h2><h3 class="title">TCGA Acronyms</h3><div class="dataBox" layout="column" flex="flex"><div class="box"><div class="heading" layout="row" flex="flex"><div flex="30">Code Name</div><div flex="30">Full Name</div><div flex="flex">Data Source</div><div flex="flex">Tumour Count</div><div flex="flex">Normal Count</div></div><div class="search" layout="row" layout-align="start end"><md-input-container flex="40"><input placeholder="Search" name="AcroSearch" ng-model="acroQuery"/></md-input-container></div><div style="max-height: 300px; overflow-y: auto;"><div class="row" layout="row" flex="flex" ng-repeat="t in tcga | filter: acroQuery"><div flex="30">{{t[\'Code Name\']}}</div><div flex="30">{{t[\'Full Name\']}}</div><div flex="flex">{{t[\'Data Source\']}}</div><div flex="flex">{{hashClean(t[\'Tumour Count\'])}}</div><div flex="flex">{{hashClean(t[\'Normal Count\'])}}</div></div></div></div></div><h2 class="title">Appendix C</h2><h3 class="title">Report Overview</h3><div class="md-padding"><p>The Tumour Genome Analysis report provides a comprehensive description of the somatic genetic alterations present in a tumour. All genes in the genome are assessed for alterations of all types, including substitutions, deletions, gene fusions, amplification, and overexpression. Both known and novel alterations which affect genes of potential clinical relevance are included in the report. Germline variants are not generally included in this report.</p><p>The Tumour Genome Analysis report is developed by Canada\'s Michael Smith Genome Sciences Centre, part of the BC Cancer Agency. Contents should be regarded as purely investigational and are intended for research purposes only.</p></div><h3 class="title">Methods Overview</h3><div class="md-padding"><p>The complete report is based on whole genome sequencing of tumour and matched normal DNA, and whole transcriptome sequencing of tumour RNA. Tumour and normal sequences are compared to the reference human genome to identify tumour-specific alterations including single nucleotide variants, small insertions and deletions, copy number changes, and structural variants such as translocations. Sequences are also assembled in a reference-independent manner to identify further structural alterations. Additionally, RNA sequences are used to measure expression of all genes, and genes with over and under-expression compared to reference tissues are identified. Somatic changes are cross-referenced to databases of therapeutic, diagnostic, prognostic, and biological information, pinpointing the alterations most likely to have clinical relevance. This comprehensive tumour description is expert reviewed by a Genome Analyst, highlighting potential driver mutations, providing pathway context, interpreting results in tumour type context, and refining potential therapeutic targets.</p></div><h3 class="title">Detailed Methods</h3><div class="md-padding"><p><strong>Genome status:</strong> Tumour content and ploidy are determined based on expert review of copy number and allelic ratios observed across all chromosomes in the tumour .</p><p><strong>Tissue comparators and expression comparisons:</strong> The most appropriate normal tissue and tumour tissues are chosen for expression comparisons based on the tumour type and observed correlation with tissue data sets. If no appropriate tissue comparator is available, for instance for rare tumours, an average across all tissues is used. Fold change in expression is calculated compared to the normal tissue, and percentile expression is calculated compared to all tumour samples of that disease type. Outlier expression refers to genes with very high or very low expression compared to what is seen in other cancers of that type.</p><p><strong>Microbial content:</strong> Sequences are compared to databases of viral, bacterial and fungal sequences in addition to the human genome. The microbial species is reported if observed levels are suggestive of microbial presence in the tumour sample. Specific viral integration sites are reported if identified in genomic DNA sequence.</p><p><strong>Mutation signature:</strong> The pattern of specific base changes and base context of single nucleotide variants in the tumour, referred to as the mutation signature, is computed and compared to patterns previously observed in a wide variety of tumour types. Signatures that suggest a particular mutation etiology, such as exposure to a specific mutagen, are noted.</p><p><strong>Mutation burden:</strong> The number of protein coding alterations of each type, including both known and novel events, are totaled and compared to other tumours of a similar type. For SNVs and indels, this includes data from TCGA, while for structural variants, comparisons are only made among POG samples due to differences in how these variants are identified in TCGA.</p><p><strong>Key genomic and transcriptomic alterations:</strong> The subset of alterations which have a previously described effect on genes of clinical or biological significance are summarized, with details of significance provided in the Detailed Genomic Analysis section, and details of the exact alteration provided in the section of the report corresponding to that mutation type. Additional alterations in these genes, which have not been previously observed and do not have an inferred functional effect, are variants of uncertain significance (VUS), and are only listed in the subsequent sections of the report. Alterations in genes which are not associated with cancer, cancer pathways, or therapeutics, are not usually included in the genomic report but are available upon request to the Genome Sciences Centre.</p><p><strong>Genomic events with potential therapeutic association:</strong> The subset of alterations with specific therapeutic associations are identified using the Genome Sciences Centre\'s expert curated Knowledgebase, which integrates information from sources including cancer databases, drug databases, clinical tests, and the literature. Associations are listed by the level of evidence for the use of that drug in the context of the observed alteration, including those that are approved in this or other cancer types, and those that have early clinical or preclinical evidence.</p></div><h2 class="title">Appendix D</h2><h3 class="title">Genomic Report v/KB v.Genome Ref hg19</h3><pre class="tcga" style="max-height: 300px; overflow-y: auto;">{{report.config}}</pre></div></div></section>');
